members.member:

Converts an URL or local file to SVG and writes the converted SVG into a stream.

The URL or local file path of the HTML document to convert to SVG.
Used to convert particular part of a HTML page to SVG
/// The stream  of the converted SVG file.


//Initialize HtmlToPdfConverter class with webkit rendering Engine.
HtmlToPdfConverter htmlConverter = new HtmlToPdfConverter(RenderEngine.WebKit);
//Setting properties for WebKit conversion.
WebKitConverterSettings webKitSettings = new WebKitConverterSettings();
//Convert HTML to SVG.
Stream stream = new MemoryStream();
htmlConverter.ConvertPartialHtmlToSvg("http://www.google.com", "lga", stream);
using (FileStream output = new FileStream(@"Sample.svg", FileMode.Create))
{
    stream.CopyTo(output);
}
stream.Dispose();


